import React, { useState } from 'react';
import { Brain, Mail, Lock, Sparkles, ArrowRight } from 'lucide-react';
import './Login.css'; // ðŸ‘‰ import file CSS

const Login = () => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [focusedField, setFocusedField] = useState('');

  const handleSubmit = () => {
    setError('');
    setLoading(true);

    const name = username.trim();
    if (!name || !password) {
      setError('Username dan password wajib diisi!');
      setLoading(false);
      return;
    }

    setTimeout(() => {
      if (name.toLowerCase() === 'demo' && password === 'demo') {
        alert('Login berhasil! Username: ' + name);
      } else {
        setError('Username atau password salah. Coba: demo/demo');
      }
      setLoading(false);
    }, 1500);
  };

  return (
    <div className="login-page">
      {/* Animated Blobs */}
      <div className="blob blob-left"></div>
      <div className="blob blob-right"></div>

      {/* Login Card */}
      <div className="login-card">
        {/* Header */}
        <div className="login-header">
          <div className="header-icon">
            <Brain className="brain-icon" strokeWidth={2.5} />
          </div>
          <h1>AI Planner</h1>
          <div className="header-subtitle">
            <Sparkles className="sparkle" />
            <span>Asisten Pribadi Cerdas Anda</span>
            <Sparkles className="sparkle" />
          </div>
        </div>

        {/* Form Section */}
        <div className="login-body">
          <h2>Selamat Datang Kembali! ðŸ‘‹</h2>
          <p>Masuk untuk mengatur jadwal Anda</p>

          {error && <div className="error-box">{error}</div>}

          {/* Username */}
          <div className="form-group">
            <label>Username</label>
            <div className="input-wrapper">
              <Mail
                className={`input-icon ${
                  focusedField === 'username' ? 'focused' : ''
                }`}
              />
              <input
                type="text"
                placeholder="Masukkan username"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
                onFocus={() => setFocusedField('username')}
                onBlur={() => setFocusedField('')}
              />
            </div>
          </div>

          {/* Password */}
          <div className="form-group">
            <label>Password</label>
            <div className="input-wrapper">
              <Lock
                className={`input-icon ${
                  focusedField === 'password' ? 'focused' : ''
                }`}
              />
              <input
                type="password"
                placeholder="Masukkan password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                onFocus={() => setFocusedField('password')}
                onBlur={() => setFocusedField('')}
                onKeyPress={(e) => e.key === 'Enter' && handleSubmit()}
              />
            </div>
          </div>

          {/* Submit Button */}
          <button onClick={handleSubmit} disabled={loading} className="submit-btn">
            {loading ? (
              <>
                <div className="spinner"></div>
                <span>Memeriksa...</span>
              </>
            ) : (
              <>
                <span>Masuk</span>
                <ArrowRight className="arrow-icon" />
              </>
            )}
          </button>

          {/* Register Link */}
          <div className="register-link">
            Belum punya akun?{' '}
            <a href="/signup">Daftar di sini â†’</a>
          </div>
        </div>

        {/* Footer */}
        <div className="login-footer">
          <p>Â© 2025 AI Planner. Semua hak dilindungi.</p>
        </div>
      </div>
    </div>
  );
};

export default Login;
